import React from 'react';
import styled from 'styled-components';

const ContactSection = styled.section`
  padding: 4em;
  background: #fff;
  color: #333;
  text-align: center;
`;

export const Contact = () => {
  return (
    <ContactSection style={{ backgroundColor: "#eaeaea" }}>
        <h1>Contact Me!</h1>
        <p>If you'd like to get in touch, feel free to reach out via email or LinkedIn.</p>
        <a href="mailto:example@example.com" style={{
          backgroundColor: "#4CAF50",
          color: "white",
          padding: "1em 2em",
          textDecoration: "none",
          borderRadius: "5px",
          marginTop: "1em",
          display: "inline-block"
        }}>Send me an Email</a>
    </ContactSection>
  );
};

export default Contact;
